import styled from "styled-components";

const Text = styled.span`
font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 16px;
line-height: 24px;
color: #666F9C;
`;
export const Link: React.FC <{ image: string; text: string }> = ({ image, text }) => {
    return (<>
        <img src={`./${image}.svg`} />
        <Text>{text}</Text>
    </>
    )
}
